sdk-integrations/quick-start/Android/.body:
Adsforce Android SDK
1. Android SDK Integration










 SDK Version: 1109 (Release Notes



2. Overview
Adsforce's SDK provides App installation and event tracking functionality. 
You can track installs, updates and sessions and also track additional in-app events beyond app installs (including in-app purchases, game levels, etc.) to evaluate ROI and user engagement levels.
3. Android SDK Integration

[info] Important
Before integrating Android SDK, you should confirm:

You have added your App to the Adsforce dashboard;

You have got SDK API Key.



Methods of getting Android SDK API Key are as follows:
1. Login Adsforce；
2. Click your App under "My Apps";

_"SDK_Setting"__click_"Copy_Content"_to_copy_SDK_API_key_">3. Under "Integration" > "SDK Setting", click "Copy Content" to copy SDK API key.

3.1. Adding the SDK to your Project
1. Unzip Adsforce SDK

2. Download AdsforceSdk_xxx.aar  and installreferrer_xxx.jar , then include them into libs directory in your project.


[success] 提示

Fileinstallreferrer_xxx.jar` is Provided by Google, a reliable way to securely retrieve install referral content;
Using this API, your app will get precise information straight from the Play Store.



If you use AndroidStudio to build project，please add the following compile statement to your app-level build.gradle (not project!).


   repositories {
       flatDir {
           dirs 'libs'
       }
   }

   dependencies {
       compile(name: 'AdsforceSdk_xxx', ext: 'aar')
       compile(name: 'installreferrer_x.x.x', ext: 'jar')
       compile 'com.google.android.gms:play-services-base:15.0.1'
   }


If using a development tool that doesn't support the gradle, but you can use the aar file, we've provided you with a play-services-base dependency library file, you can download the files and add them to your project.

If using a development tool that doesn't support to use the aar file, the play-services-base dependent library cannot be used in this case. Simply import the installreferrer_xxx.jar file, unzip the AdsforceSdk_xxx.aar ,then rename the classes.jar and import it into the project. Finally copy the following codes into AndroidManifest.xml file of your project.







3.2. Initialize the SDK
1. Please register your App on Portal;
2. Get the SDK from SDK Settings page;
  1) Click your App to be configured;

  2) Click "Integration" > "SDK Settings";

  3) Refer to the initialization code generated by the website.

3. Initialize AdsforceSdk in the Application.onCreate().
Sample code:
 public class MyApplication extends Application {

     @Override
     public void onCreate() {
         super.onCreate();
         AdsforceSdk.initSdk(this, "","", "https:///", "");
     }
 }
3.3. About DeepLink
If you want to know the deeplink information , you can call the following code to get the user's deeplink information after initialization.
AdsforceSdk.getDeepLink(getApplicationContext(), new AdsforceDeepLinkCallback() {
    @Override
    public void onDeepLinkCallback(String deepLink) {
        if (deepLink != null) {
            Log.i(TAG, "referrer deeplink is " + deepLink);
        } else {
            Log.i(TAG, "referrer deeplink is null");
        }
    }
});
​     
4. About Google Payment Report
If the in-app purchase uses the google payment, you can call the following method to report this payment.
 /**
  * In-app purchase record(Google-certified)
  *
  * @param price          Payment amount, recommended to take from the 'price' field of skudetail, must be more than 0
  * @param currency       Payment currency，Payment amount, recommended to take from the 'price_currency_code' field of skudetail, can not be empty
  * @param publicKey      Public key of Google payment，can be empty
  * @param dataSignature  Signature verification from GP payment, get from Purchase.getSignature()，can not be empty
  * @param purchaseData   Signature verification from GP payment, get from Purchase.getOriginalJson()，can not be empty
  * @param params         Other params，can be empty
  */
 AdsforceSdk.googleZFReportWithProductPrice(double price, @NonNull String currency, String publicKey, @NonNull String dataSignature, @NonNull String purchaseData, Map params);

[warning] Note
This method must be called after initializing the SDK.

5. About Third-party Payment Report
If the in-app purchase uses the third-party payment, you can call the following method to report this payment.
 /**
  * In-app purchase record(custom)
  *
  * @param price        Payment amount, recommended to take from the 'price' field of skudetail, must be more than 0
  * @param currency     Payment currency，Payment amount, recommended to take from the 'price_currency_code' field of skudetail, can not be empty
  * @param productId    Id of product，recommended to take from the 'productId' field of skudetail，can be empty
  * @param productType  Type of product，recommended to take from the 'type' field of skudetail，can be empty
  */
 AdsforceSdk.thirdZFReportWithProductPrice(double price, @NonNull String currency, String productId, String productType);

[warning] Note
This method must be called after initializing the SDK.

6. Custom Event Report
Depending on the type of the reported parameters, you can select one of the following three methods for reporting.
 /**
  * Custom event report
  *
  * @param key   Key of event
  * @param value Data for reproting
  */
 AdsforceSdk.customerEventWithValue(String key, String value);

 /**
  * Custom event report
  *
  * @param key Key of event
  * @param map Use HashMap for reproting
  */
 AdsforceSdk.customerEventWithMap(String key, HashMap map);

 /**
  * Custom event report
  *
  * @param key  Key of event
  * @param list Use Arraylist for reproting
  */
 AdsforceSdk.customerEventWithList(String key, ArrayList list);

[warning] Note
Please call this method must be called after initializing the SDK.

7. Set AndroidId

[warning] Note
Please call this method must be called before initializing the SDK.

In order to ensure the accuracy of the data , Please ensure that the privacy of the user will not be revealed and call the following method to pass the AndroidId to us.
 AdsforceSdk.setAndroidId(getApplicationContext(), getAndroidId());
